 c1-99 c1-9a c1-9b c1-9c c1-9d c1-9e c1-9f c1-9g c1-9h c1-9i c1-9j c1-9k c1-9l c1-9m c1-9n c1-9o c1-b c1-41 c1-c c1-30 c1-9p c1-9q c1-9r c1-d c1-e c1-f c1-g x-d-ux x-d-aid x-d-route x-d-field-route x-rt"><p style="margin:0"><span>I've loved taking pictures since I took my first photography class in high school. And I'm inspired by the love I have for my home city. &nbsp;I have also photographed many different subjects, scenes, and moments all over the world. There's a picture around every corner.</span></p></div></div></div></div></div><div data-ux="GridCell" class="x-el x-el-div c1-1 c1-2 c1-4n c1-1d c1-4u c1-8i c1-12 c1-4x c1-8j c1-8k c1-8l c1-b c1-c c1-4z c1-50 c1-51 c1-52 c1-d c1-e c1-f c1-g x-d-ux"><div data-ux="Grid" data-field-id="cards" data-field-route="/card/1" class="x-el x-el-div c1-1 c1-2 c1-1b c1-4n c1-4o c1-4p c1-1g c1-8f c1-1h c1-8h c1-1e c1-b c1-c c1-4q c1-4r c1-8m c1-4t c1-d c1-e c1-f c1-g x-d-ux x-d-field-id x-d-field-route"><div data-ux="GridCell" class="x-el x-el-div c1-1 c1-2 c1-4n c1-1d c1-4u c1-8i c1-12 c1-4x c1-8j c1-4y c1-8l c1-1b c1-1e c1-1c c1-b c1-c c1-8n c1-8o c1-4z c1-50 c1-8p c1-52 c1-d c1-e c1-f c1-g x-d-ux"><div data-ux="ContentBasic" index="1" class="x-el x-el-div x-el c1-1 c1-2 c1-1b c1-1w c1-4 c1-8q c1-1c c1-2m c1-8r c1-8s c1-b c1-c c1-8t c1-8u c1-d c1-e c1-f c1-g x-d-ux c1-1 c1-2 c1-b c1-c c1-d c1-e c1-f c1-g x-d-ux"><h4 typography="HeadingDelta" data-ux="ContentHeading" data-aid="ABOUT_HEADLINE_RENDERED1" data-route="cards.headline" data-field-route="/card/1" class="x-el x-el-h4 c1-8v c1-2 c1-28 c1-29 c1-8w c1-17 c1-18 c1-1g c1-1h c1-b c1-69 c1-6a c1-30 c1-6c c1-6e c1-6f c1-6g x-d-ux x-d-aid x-d-route x-d-field-route">Photography as Communication</h4><div typography="BodyAlpha" data-ux="ContentText" alignment="center" data-aid="ABOUT_DESCRIPTION_RENDERED1" data-route="cards.description" data-field-route="/card/1" class="x-el x-el-p c1-1 c1-2 c1-28 c1-29 c1-4l c1-1g c1-1h c1-8x c1-8y c1-8z c1-90 c1-91 c1-92 c1-93 c1-94 c1-95 c1-96 c1-97 c1-98 c1-99 c1-9a c1-9b c1-9c c1-9d c1-9e c1-9f c1-9g c1-9h c1-9i c1-9j c1-9k c1-9l c1-9m c1-9n c1-9o c1-b c1-41 c1-c c1-30 c1-9p c1-9q c1-9r c1-d c1-e c1-f c1-g x-d-ux x-d-aid x-d-route x-d-field-route x-rt"><p style="margin:0"><span>I am surrounded both by natural beauty and interesting people. I use my camera to document the world and then print images with a focus on the magic I find in daily life. My pictures tell my stories.&nbsp;</span></p></div></div></div></div></div><div data-ux="GridCell" class="x-el x-el-div c1-1 c1-2 c1-4n c1-1d c1-4u c1-8i c1-12 c1-4x c1-8j c1-8k c1-8l c1-b c1-c c1-4z c1-50 c1-51 c1-52 c1-d c1-e c1-f c1-g x-d-ux"><div data-ux="Grid" data-field-id="cards" data-field-route="/card/2" class="x-el x-el-div c1-1 c1-2 c1-1b c1-4n c1-4o c1-4p c1-1g c1-8f c1-1h c1-8h c1-1e c1-b c1-c c1-4q c1-4r c1-8m c1-4t c1-d c1-e c1-f c1-g x-d-ux x-d-field-id x-d-field-route"><div data-ux="GridCell" class="x-el x-el-div c1-1 c1-2 c1-4n c1-1d c1-4u c1-8i c1-12 c1-4x c1-8j c1-4y c1-8l c1-1b c1-1e c1-1c c1-b c1-c c1-8n c1-8o c1-4z c1-50 c1-8p c1-52 c1-d c1-e c1-f c1-g x-d-ux"><div data-ux="ContentBasic" index="2" class="x-el x-el-div x-el c1-1 c1-2 c1-1b c1-1w c1-4 c1-8q c1-1c c1-2m c1-8r c1-8s c1-b c1-c c1-8t c1-8u c1-d c1-e c1-f c1-g x-d-ux c1-1 c1-2 c1-b c1-c c1-d c1-e c1-f c1-g x-d-ux"><h4 typography="HeadingDelta" data-ux="ContentHeading" data-aid="ABOUT_HEADLINE_RENDERED2" data-route="cards.headline" data-field-route="/card/2" class="x-el x-el-h4 c1-8v c1-2 c1-28 c1-29 c1-8w c1-17 c1-18 c1-1g c1-1h c1-b c1-69 c1-6a c1-30 c1-6c c1-6e c1-6f c1-6g x-d-ux x-d-aid x-d-route x-d-field-route">Sharing Stories</h4><div typography="BodyAlpha" data-ux="ContentText" alignment="center" data-aid="ABOUT_DESCRIPTION_RENDERED2" data-route="cards.description" data-field-route="/card/2" class="x-el x-el-p c1-1 c1-2 c1-28 c1-29 c1-4l c1-1g c1-1h c1-8x c1-8y c1-8z c1-90 c1-91 c1-92 c1-93 c1-94 c1-95 c1-96 c1-97 c1-98 c1-99 c1-9a c1-9b c1-9c c1-9d c1-9e c1-9f c1-9g c1